import { View,StyleSheet,Text } from "react-native"
import { TouchableOpacity } from "react-native"
import { Image } from "react-native"
import { Ionicons } from "@expo/vector-icons";

export const BoxHelper = ({onPress,imageUri,HelperType},...props) => {
   
    return (
        <TouchableOpacity onPress={onPress} style={{height:100,width:130,marginLeft:-1,borderWidth:1,borderColor:"gray",justifyContent:'center',alignItems:'center',backgroundColor:'white'}}>     
          
            <Image style={{ width: 35, height: 35 }} source={imageUri} />
            <Text style={{marginTop:15,fontWeight:'bold',color:"#1976d2",fontSize:11}}>{HelperType}</Text>
        
        </TouchableOpacity>
    )

}
